import { useState } from 'react';
import './App.css';
import './App.scss';
import Attributes from './Components/Attributes';
import Board from './Components/Board';


function App() {
  const [winner , setWinner] = useState(null);
  const getData = (winner) => {
    setWinner(winner);
  }
  return (
    <div className="App">
      <Attributes winner={winner}/>
      <center><Board getData={(winner)=>getData(winner)}/></center>
    </div>
  );
}

export default App;
